import React, { useState } from 'react';
import axios from 'axios';
// (Puedes importar tu CSS aquí, ej: import '../styles/pages/ContactoPage.css';)

const ContactoPage = (props) => {

  // Definimos el estado inicial del formulario
  const initialForm = {
    nombre: '',
    email: '',
    telefono: '',
    mensaje: ''
  }; // [cite: 2311-2316]

  // --- Hooks de Estado ---
  const [sending, setSending] = useState(false);
  const [msg, setMsg] = useState('');
  const [formData, setFormData] = useState(initialForm); // 

  // --- Manejador de Cambios ---
  // Se activa cada vez que el usuario escribe en un input
  const handleChange = e => {
    const { name, value } = e.target;
    setFormData(oldData => ({
      ...oldData,
      [name]: value // Actualiza la propiedad 'name' (ej: nombre) con el 'value'
    }));
  }; // 

  // --- Manejador de Envío ---
  // Se activa al presionar "Enviar"
  const handleSubmit = async e => {
    e.preventDefault(); // Previene que el formulario se recargue
    setMsg(''); // Limpia mensajes anteriores
    setSending(true); // Muestra "Enviando..."
    
    try {
      // Usamos la variable de entorno para la URL de la API
      const response = await axios.post(`${process.env.REACT_APP_API_URL}/api/contacto`, formData);
      
      setSending(false); // Oculta "Enviando..."
      setMsg(response.data.message); // Muestra el mensaje de éxito de la API

      if (response.data.error === false) {
        setFormData(initialForm); // Resetea el formulario
      }
    } catch (error) {
      setSending(false);
      setMsg('Ocurrió un error, intente nuevamente.'); // Mensaje de error genérico
      console.log(error);
    }
  }; // [cite: 2327-2338]

  // --- Renderizado del Componente (JSX) ---
  return (
    <main className="holder contacto">
      <div>
        <h2>Contacto Rápido</h2>
        
        {/* Usamos handleSubmit en el <form> */}
        <form className="formulario" onSubmit={handleSubmit}>
          <p>
            <label>Nombre</label>
            {/* Conectamos el 'value' al estado (formData.nombre)
              Conectamos el 'onChange' al manejador (handleChange)
            */}
            <input 
              type="text" 
              name="nombre" 
              value={formData.nombre} 
              onChange={handleChange} 
            />
          </p>
          <p>
            <label>Email</label>
            <input 
              type="text" 
              name="email" 
              value={formData.email} 
              onChange={handleChange} 
            />
          </p>
          <p>
            <label>Teléfono</label>
            <input 
              type="text" 
              name="telefono" 
              value={formData.telefono} 
              onChange={handleChange} 
            />
          </p>
          <p>
            <label>Comentario</label>
            <textarea 
              name="mensaje" 
              value={formData.mensaje} 
              onChange={handleChange}
            ></textarea>
          </p>
          
          {/* Renderizado condicional para feedback al usuario */}
          {sending ? <p>Enviando...</p> : null}
          {msg ? <p>{msg}</p> : null}
          
          <p className="centrar">
            <input type="submit" value="Enviar" />
          </p>
        </form>
      </div>

      <div className="datos">
        <h2>Otras vías de comunicación</h2>
        <p>También puede contactarse con nosotros usando los siguientes medios:</p>
        <ul>
          <li>Teléfono: 4321-1234</li>
          <li>Email: contacto@transportesX.com.ar</li>
          <li>Facebook: ...</li>
          <li>Twitter: ...</li>
          <li>Skype: ...</li>
        </ul>
      </div>
    </main>
  );
}

export default ContactoPage;
